import React, { useEffect, useState } from 'react'
import { useDispatch } from 'react-redux'


export default function NotFound() {


    const dispatch = useDispatch()
    const onUserLogout = (e) => {
        e.preventDefault();
        dispatch(logout())
    }

    return (
        <>
            <h1>NotFound Is Working Fine</h1>

        </>
    )

}
